        <div className="postCats">
          <span className="postCat">Music</span>
          <span className="postCat">Life</span>
        </div>
        <span className="postTitle">
          Lorem ipsum dolor sit, amet consectetur adipisicing elit. Laboriosam
          impedit illo magnam dicta blanditiis, tempore numquam obcaecati veniam
          exercitationem, labore, tenetur voluptate quia vitae enim animi.
          Laudantium consequuntur quisquam quae?
        </span>
      </div>
    </div>
  );
};

export default Post;
